import React from "react";

class List extends React.Component{
    render(){
        return(
            <div>
                <h1>Chores</h1>
               <input type="checkbox"><ul>
                    {this.props.items.map((item, index) =>
                        <li key={index}>{item}</li>)}
                </ul></input>
            </div>
        )
    }
}

export default List
